css:
.btn.btn.nuclide-ui-dropdown-flat {
  background: transparent;
  border: none;
  border-radius: 0;
  border-right: 1px solid #151f28;
  padding-left: 0;
  line-height: inherit;
  outline: none;
  -webkit-appearance: none;
}
.nuclide-ui-dropdown-icon::before {
  height: 1em;
  font-size: 11px;
  width: initial;
  margin-right: 0;
}
.nuclide-dropdown-label-text-wrapper {
  margin-right: 10px;
  overflow: hidden;
  text-overflow: ellipsis;
}
.nuclide-ui-dropdown {
  display: flex;
  justify-content: space-between;
}
